                labelRenderer.setSize(window.innerWidth, window.innerHeight);
                labelRenderer.domElement.style.position = 'absolute';

                labelRenderer.domElement.style.pointerEvents = 'none';
                document.body.appendChild(labelRenderer.domElement);

                        opacity: capsule.intensity,
                        transparent: true,
                        shininess: 30

                    const mesh = new THREE.Mesh(primaryGeometry, material);
                    mesh.position.set(...capsule.position);
                    mesh.userData = {

                    };

                    line.userData = {

                    };

                    scene.add(label);

                const mouse = new THREE.Vector2();
                let selectedLayer = null;

                    mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

                    raycaster.setFromCamera(mouse, camera);

                    const hoverableCapsules = primaryMeshes.filter(mesh => {

                            return true; // All capsules hoverable when no layer selected
                        }
                        return mesh.userData.layer === selectedLayer;
                    });
                    
                    const intersects = raycaster.intersectObjects(hoverableCapsules);
                    
                    if (intersects.length > 0) {
                        const capsule = intersects[0].object;
                        document.getElementById('capsuleInfo').textContent =

                        document.getElementById('capsuleInfo').textContent = '-';
                    }
                });

                // Click handling
                window.addEventListener('click', (event) => {
                    raycaster.setFromCamera(mouse, camera);
                    const intersects = raycaster.intersectObjects(primaryMeshes);

                    if (intersects.length > 0) {
                        const clickedObject = intersects[0].object;
                        const layerIndex = clickedObject.userData.layer;
                        
                        if (selectedLayer === layerIndex) {
                            // Unselect the layer if it's clicked again
                            // selectedLayer = null;
                            primaryMeshes.forEach(mesh => {
                                mesh.material.opacity = mesh.userData.originalOpacity;
                            });
                            connectionLines.forEach(line => {
                                line.material.opacity = line.userData.originalOpacity;
                            });
                        } else {
                            // Select new layer
                            selectedLayer = layerIndex;
                            primaryMeshes.forEach(mesh => {
                                mesh.material.opacity = mesh.userData.layer === layerIndex ? 
                                    mesh.userData.originalOpacity : 0.01;
                            });
                            connectionLines.forEach(line => {
                                line.material.opacity = line.userData.layer === layerIndex ? 
                                    line.userData.originalOpacity : 0.01;
                            });
                        }
                    }
                });

                // Reset on double click
                window.addEventListener('dblclick', () => {
                    selectedLayer = null;
                    primaryMeshes.forEach(mesh => {
                        mesh.material.opacity = mesh.userData.originalOpacity;
                    });
                    connectionLines.forEach(line => {
                        line.material.opacity = line.userData.originalOpacity;
                    });
                });

                // Navigation
                function moveCamera(direction) {
                    const moveDistance = 5;
                    if (direction === 'left') {
                        camera.position.x -= moveDistance;
                        controls.target.x -= moveDistance;
                    } else {
                        camera.position.x += moveDistance;
                        controls.target.x += moveDistance;
                    }
                    controls.update();
                }

                document.getElementById('leftBtn').onclick = () => moveCamera('left');
                document.getElementById('rightBtn').onclick = () => moveCamera('right');

                // Animation loop
                function animate() {
                    requestAnimationFrame(animate);
                    controls.update();
                    renderer.render(scene, camera);
                    labelRenderer.render(scene, camera);
                }
                animate();

                // Window resize handling
                window.addEventListener('resize', () => {
                    camera.aspect = window.innerWidth / window.innerHeight;
                    camera.updateProjectionMatrix();
                    renderer.setSize(window.innerWidth, window.innerHeight);
                    labelRenderer.setSize(window.innerWidth, window.innerHeight);
                });
